script: |
  super -f text -I q8845.spq | sort > q8845.out

inputs:
  - name: q8845.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE NOT + ( 14 ) - - 15 NOT BETWEEN 21 * 19 * - col0 + - col1 AND 63;
  - name: tab0

outputs:
  - name: q8845.out
    data: |
      15	81	47
      87	21	10
      97	1	99
